import React from "react";

export default function ServiceCard (props){
    return (
        <div className="service-card">
            <div classNane="flex justify-center align-center">
                {props.svg}
                <h3>{props.heading}</h3>
            </div>
            <p>Easily manage your loans, track your credit score, and discover government schemes and NGOs that offer affordable loans.</p>
        </div>
    );
}
